!function(){RecipesData={"spring-fromage-fort":{title:"Fromage Fort",highlighted:!0,excerpt:"When I’ve got too many cheese bits on hand, it's now fromage fort to the rescue",source:{name:"David Lebovitz",url:"http://www.davidlebovitz.com/2014/04/fromage-forte-cheese-dip-spread-recipe/"},cookTime:"15 min",ingredients:["8 ounces (225g) cheese pieces, hard rinds removed","1 to 2 ounces (30 to 60g) cream cheese","1/4 cup (60ml) dry white wine","1 garlic clove, peeled and minced","a few turns of freshly ground black pepper","pinch of cayenne or red pepper powder","1 tablespoon minced chives or flat-leaf parsley","chives or parsley, for garnish"],directions:["Cut the cheese into bite-sized cubes and put them in the bowl of a food processor with 1 ounce (30g) of the cream cheese, wine, garlic, and the black and red peppers.","Process the mixture until completely smooth. If it is not completely smooth (which may happen if you are starting with an assortment of harder cheeses), add the additional cream cheese, and continue to process."],name:"spring-fromage-fort"},"spring-ragu-bolognese":{title:"Classic Ragu Bolognese",excerpt:"A certain magic happens as the beef and aromatic vegetables slowly cook down with wine, tomato paste, and broth",source:{name:"Bon Appétit",url:"http://www.bonappetit.com/recipe/classic-rag-bolognese"},cookTime:"1 hr 10 min",ingredients:["2 Tbsp. extra-virgin olive oil","2 medium onions, finely chopped (about 1 1/2 cups)","2 celery stalks, finely chopped (about 1 cup)","2 carrots, peeled, finely chopped (about 3/4 cup)","6 oz. ground beef (85% lean)","6 oz. ground veal","3 oz. thinly sliced pancetta, finely chopped","1/2 cup dry red wine","3 cups (about) beef stock or chicken stock, divided","3 Tbsp. tomato paste","Kosher salt and freshly ground black pepper","1 cup whole milk","1 lb. tagliatelle or fettuccine (preferably fresh egg)","Finely grated Parmesan (for serving)"],directions:["Heat oil in a large heavy pot over medium-high heat.","Add onions, celery, and carrots."],name:"spring-ragu-bolognese"},"spring-animal-cracker-cookies":{title:"Animal-Cracker Cookies",excerpt:"Create and decorate magical cookies that are as much fun as a day at the circus!",source:{name:"Williams-Sonoma",url:"http://www.williams-sonoma.com/recipe/animal-cracker-cookies.html"},cookTime:"1 hr",ingredients:["2 1/2 cups all-purpose flour","1 tsp. baking powder","1/2 tsp. salt","1/8 tsp. freshly grated nutmeg","1/8 tsp. mace","12 Tbs. (1 1/2 sticks) unsalted butter, at room temperature","1 cup sugar","1 egg","1 tsp. vanilla extract"],directions:["Over a small bowl, sift together the flour, baking powder, salt, nutmeg and mace. Set aside.","In the bowl of an electric mixer fitted with the flat beater, beat the butter on high speed for 2 minutes. Reduce the speed to medium, slowly add the sugar and beat for 2 minutes, stopping the mixer occasionally to scrape down the sides of the bowl. Add the egg and vanilla and beat for 1 minute, stopping the mixer once to scrape down the sides of the bowl."],name:"spring-animal-cracker-cookies"},"spring-chicken-in-mole":{title:"Chicken in Molé",excerpt:"If there is one dish that could be considered Mexican haute cuisine, then Mole Poblano is surely it",source:{name:"Epicurious",url:"http://www.epicurious.com/recipes/food/views/Chicken-in-Mole-Puebla-Style-238185"},cookTime:"2 hr",ingredients:["4 pounds chicken pieces, skin on","Sea salt and ground black pepper to taste","2 tablespoons sesame seeds, toasted, for garnish","white rice","9 mulato chiles","7 pasilla chiles","6 ancho chiles","1 cup plus 9 tablespoons vegetable oil or lard plus additional as needed","4 or 5 tomatillos, husked and cooked until soft","5 whole cloves","20 whole black peppercorns","1-inch piece of a Mexican cinnamon stick","1 tablespoon seeds from the chiles, toasted","1/2 teaspoon anise seeds, toasted","1/4 teaspoon coriander seeds, toasted","8 tablespoons sesame seeds, toasted","4 garlic cloves, roasted","3 tablespoons raisins","20 whole almonds, blanched","1/4 cup pumpkin seeds","2 corn tortillas, torn into pieces","3 stale French rolls, cut into 1-inch slices","6 to 7 cups reserved chicken broth as needed","1 1/2 ounces Mexican chocolate, chopped"],directions:["In a large stock pot, parboil the chicken in water seasoned with salt and pepper to taste. Drain, reserving cooking broth, and refrigerate until ready to assemble the dish.","Prepare the Mole Poblano. Clean the chiles by removing stems, veins, and seeds; reserve 1 tablespoon of the seeds."],name:"spring-chicken-in-mole"},"spring-spanish-asparagus-revuelto":{title:"Spanish Asparagus Revuelto",excerpt:"In Spain, wild asparagus is very popular, and it’s a sure sign of spring",source:{name:"NY Times",url:"http://www.nytimes.com/recipes/1016240/spanish-asparagus-revuelto.html"},cookTime:"30 min",ingredients:["Olive oil","2 peeled garlic cloves, plus 1/2 teaspoon minced garlic","2 cups bread cubes, made with day-old bread, cut in 1/2-inch cubes","Salt and pepper","2 ounces diced Spanish chorizo","1 bunch thin asparagus, about 1 1/2 pounds, cut in 1- to 2-inch lengths","1 bunch green onions, chopped","8 large eggs, beaten","1/2 teaspoon pimentón","2 tablespoons roughly chopped Italian parsley"],directions:["Put 3 tablespoons olive oil in a cast-iron skillet over medium-high heat. Add peeled garlic cloves and let them sizzle until lightly browned, then remove.","Add bread cubes, season with salt and pepper, lower heat to medium and gently fry until lightly browned and crisp, about 2 minutes. Remove bread and set aside to cool."],name:"spring-spanish-asparagus-revuelto"},"spring-meatloaf":{title:"Fatted Calf's Meatloaf",highlighted:!0,excerpt:"It is a thing of beauty, shaped into a large oval loaf and glazed with tangy cocktail sauce",source:{name:"Food52",url:"http://food52.com/recipes/24302-fatted-calf-s-meatloaf"},cookTime:"1 hr 30 min",ingredients:["3/4 teaspoons black peppercorns","2 allspice berries","2 teaspoons fennel seed","1 teaspoon chile flakes","1 whole clove","1 1/4 pound boneless lean beef from eye of round or sirloin, cut into 1-inch cubes","1 pound boneless pork picnic, cut into 1-inch cubes","4 ounces pork back fat, cut into 1-inch cubes","Sea salt","2 teaspoons chopped garlic","4 ounces chopped bacon","2 cups diced yellow onion","2 tablespoons unsalted butter","6 tablespoons fresh breadcrumbs","1 egg lightly beaten","1/2 cup ketchup","1 1/2 teaspoon Tabasco sauce","1 1/4 teaspoon Worcestershire sauce","1 teaspoon grated fresh horseradish","1/4 cup chopped parsley","2 tablespoons chopped oregano","1 tablespoon chopped thyme","1 tablespoon chopped sage","1/4 cup ketchup","1/4 teaspoon sea salt","1/4 teaspoon freshly ground black pepper","1 1/2 teaspoon grated fresh horseradish","1/2 teaspoon Worcestershire sauce","1/2 teaspoon Tabasco sauce"],directions:["Preheat the oven to 325° F (165° C). To make the forcemeat, spread the peppercorns and allspice on a baking sheet and toast for 3 to 5 minutes, until fragrant. Let cool completely.","Toast the fennel seeds the same way, then let cool completely."],name:"spring-meatloaf"},"spring-lahmacun-turkish-pizza":{title:"Lahmacun - Turkish Pizza",excerpt:"",source:{name:"Ottolenghi",url:"http://www.ottolenghi.co.uk/lahmacun-turkish-pizza-with-spicy-minced-beef-and-salad-topping-shop"},cookTime:"40 min",ingredients:["250g minced beef","1 medium onion, finely chopped (180g net)","3 3/4 tsp salt","1 1/2 tsp ground cinnamon","1 1/2 tsp ground allspice","1/2 tsp red chilli flakes","25g flat-leaf parsley, chopped","2 tbsp pomegranate molasses","1 1/2 tbsp sumac","3 tbsp tahini","25g pine nuts","2 tbsp lemon juice","250g white flour, plus extra to dust","1 1/2 tbsp milk powder","1/2 tbsp salt","2 tsp fast-action dried yeast","1/2 tbsp caster sugar","60ml sunflower oil","1 medium egg","100ml lukewarm water","Olive oil for brushing"],directions:["Start with the dough. Put the flour, milk powder, salt, yeast and sugar in a large mixing bowl and stir well to combine.","Make a well in the centre. Add the sunflower oil and egg and stir as you add the water."],name:"spring-lahmacun-turkish-pizza"},"spring-easiest-spaghetti-and-meatballs":{title:"Easiest Spaghetti & Meatballs",excerpt:"No pasta's more iconic than spaghetti and meatballs",source:{name:"Martha Stewart",url:"http://www.marthastewart.com/336523/easiest-spaghetti-and-meatballs?czone=food%2Fdinner-tonight-center%2Fdinner-tonight-main-courses&gallery=274538&slide=336523&center=276948"},cookTime:"30 min",ingredients:["Coarse salt and ground pepper","1/4 cup finely grated Parmesan, plus more for serving","1/4 cup chopped fresh parsley","2 garlic cloves, minced","1 large egg","1 pound ground beef chuck","1/4 cup plain dried breadcrumbs","1 tablespoon olive oil","1 can (28 ounces) crushed tomatoes in puree","3/4 pound spaghetti"],directions:["Set a large pot of salted water to boil. In a bowl, combine Parmesan, parsley, garlic, egg, 1 teaspoon salt, and 1 teaspoon pepper. Add beef and breadcrumbs; mix gently. Form into 16 balls.","In a 5-quart Dutch oven or heavy pot, heat oil over medium. Add meatballs, and cook, turning occasionally, until browned, 8 to 10 minutes."],name:"spring-easiest-spaghetti-and-meatballs"},"summer-shaking-beef":{title:"Slanted Door's Shaking Beef",excerpt:"Cubes of tender filet mignon are sautéed with red onions and a vinaigrette",source:{name:"7x7 magazine",url:"http://www.7x7.com/recipes/secret-recipe-slanted-doors-shaking-beef"},cookTime:"25 min",ingredients:["1 1/2 - 2 pounds filet mignon, fat trimmed and cut into 1 1/4-inch cubes","1 teaspoons ground black pepper","1/2 cup plus 1 tablespoon canola oil","1 cup thinly sliced red onion, preferably spring onions","3 stalks green onion, trimmed and cut to 1-inch lengths","1 tablespoon chopped garlic","2 tablespoons unsalted butter","2 tablespoons white vinegar","1/4 cup white granulated sugar","1/4 cup light soy sauce","1/4 cup fish sauce","1 teaspoon cooking rice wine"],directions:["Marinate meat 1/2 teaspoon black pepper and 1 tablespoon oil for about 2 hours.","Meanwhile, make the stir-fry sauce by combining the white vinegar, sugar, soy, fish sauce, and rice wine. Mix until sugar is dissolved. Set aside."],name:"summer-shaking-beef"},"summer-bavarian-pretzel":{title:"Bavarian-style Soft Pretzel",excerpt:"",source:{name:"NY Times",url:"http://www.nytimes.com/2010/05/26/dining/26pretzelrex1.html"},cookTime:"1 hr 30 min",ingredients:["1 tablespoon barley malt syrup or dark brown sugar","2 tablespoons lard or softened unsalted butter","2 tablespoons instant yeast","6 cups (about 30 ounces) bread flour","1 tablespoon plus 1/2 teaspoon kosher salt","Food-grade lye, for dipping","Coarse sea salt or pretzel salt, for sprinkling (do not substitute kosher salt)"],directions:["In a mixing bowl (or bowl of a mixer), stir together syrup, lard or butter, yeast, 2 cups warm water and half the flour. Add kosher salt and remaining flour and stir just until mixture comes together in a shaggy mass.","Turn out onto counter (or attach dough hook to mixer) and knead for 8 to 10 minutes, until smooth and supple. Cut into 12 pieces and let rest 5 minutes."],name:"summer-bavarian-pretzel"},"summer-apricots-honey-panna-cotta":{title:"Apricots Honey Panna Cotta",highlighted:!0,excerpt:"Juicy, fragrant, perfectly textured for a little fire action",source:{name:"Tartelette",url:"http://www.tarteletteblog.com/2011/07/recipe-gluten-free-apricots-honey-panna.html"},cookTime:"35 min",ingredients:["6 apricots","olive oil","1/4 cup water","1 tablespoon powdered gelatin (2 sheets gelatin)","2 cups heavy cream","1/4 cup honey","1 cup full fat buttermilk"],directions:["Cut the apricots in half and remove the pit. Brush lightly with olive oil and grill over hot coals until tender (about 3-4 minutes on each side).","Let cool and puree until smooth in a food processor. Divide the mixture between 6 glasses."],name:"summer-apricots-honey-panna-cotta"},"summer-elderberry-syrup":{title:"Elderberry Syrup",excerpt:"The gorgeous syrup is great in a glass of sparkling water over ice, dripped some over plain yogurt",source:{name:"David Lebovitz",url:"http://www.davidlebovitz.com/2007/08/respect-your-el/"},cookTime:"35 min",ingredients:["2 pounds (1kg) elderberries, stems removed and rinsed","4 cups (1l) water","2 1/2 (500g) cups sugar","squirt of freshly-squeezed lemon juice"],directions:["Put the elderberries in a large, non-reactive pot with the water. Bring to a boil, then reduce heat to a low boil and cook for 15-20 minutes, until tender and soft.","Pass through a food mill, then discard the skins."],name:"summer-elderberry-syrup"},"summer-spaghetti-lemon-olive":{title:"Spaghetti with Lemon & Olive Oil",excerpt:"This is one of those recipes that are almost better off without one",source:{name:"Smitten Kitchen",url:"http://smittenkitchen.com/blog/2011/02/spaghetti-with-lemon-and-olive-oil-al-limone/"},cookTime:"20 min",ingredients:["1 pound spaghetti or linguine","Salt","3 lemons","1/4 cup extra virgin olive oil , plus additional for serving","1/4 cup heavy cream","1 ounce finely grated Parmesan cheese (about 1/2 cup), plus additional for serving","Ground black pepper","Small handful fresh basil or arugula leaves, shredded"],directions:["Cook linguine or spaghetti in well-salted water to your al dente tastes in a large, wide-bottomed pot.","While pasta is cooking, zest lemons until you have a little shy of a tablespoon of zest. Juice lemons — you’ll have anywhere from 1/3 to 1/2 cup lemon juice."],name:"summer-spaghetti-lemon-olive"},"summer-homemade-pasta-dough":{title:"Homemade Pasta Dough",excerpt:"",source:{name:"Mario Batali",url:"http://www.mariobatali.com/recipes/basic-pasta-dough/"},cookTime:"25 min",ingredients:["2 Cups All-Purpose Flour","2 Cups 00 Flour or 4 cups All-Purpose Flour","4 large Eggs"],directions:["Mound the flour in the center of a large wooden board. Make a well in the center of the flour and add the eggs. Using a fork, beat the eggs together and then begin to incorporate the flour; starting with the inner rim of the well. As you expand the well, keep pushing the flour up to retain the well shape (do not worry if it looks messy).","When half of the flour is incorporated, the dough will begin to come together. Start kneading the dough, using primarily the palms of your hands. Once the dough is a cohesive mass, set the dough aside and scrape up and discard any dried bits of dough."],name:"summer-homemade-pasta-dough"},"summer-hamburger":{title:"Diner Style Hamburgers",excerpt:"This is the traditional, griddled hamburger of diners and takeaway spots, smashed thin and cooked crisp on its edges",source:{name:"NY Times",url:"http://www.nytimes.com/recipes/1016595/hamburgers-diner-style.html"},cookTime:"20 min",ingredients:["1/2 teaspoon neutral oil, like canola, or a pat of unsalted butter","2 pounds ground chuck, at least 20 percent fat","Kosher salt and black pepper to taste","8 slices cheese (optional)","8 soft hamburger buns, lightly toasted","Lettuce leaves, sliced tomatoes and condiments"],directions:["Add oil or butter to a large cast-iron or stainless-steel skillet and place over medium heat. Gently divide ground beef into 8 small piles of around 4 ounces each, and even more gently gather them together into orbs that are about 2 inches in height. Do not form patties.","Increase heat under skillet to high. Put half the orbs into the skillet with plenty of distance between them and, using a stiff metal spatula, press down on each one to form a burger that is around 4 inches in diameter and about 1/2 inch thick. Season with salt and pepper."],name:"summer-hamburger"},"fall-roasted-butternut-squash-lasagna":{title:"Roasted Butternut Squash Lasagna",highlighted:!0,excerpt:"Making homemade pasta may seem arduous, but this dish is worth the extra work",source:{name:"Martha Stewart",url:"http://www.marthastewart.com/857657/roasted-butternut-squash-lasagna"},cookTime:"1 hr 35 min",ingredients:["2 large butternut squashes (about 2 pounds each), halved lengthwise and seeded","3 tablespoons extra-virgin olive oil","Coarse salt and freshly ground pepper","1 stick unsalted butter, cut into pieces","2 1/4 cups finely grated Parmesan cheese (about 8 ounces)","1/2 cup finely crushed amaretti cookies","1/4 cup finely chopped fresh sage","1/4 teaspoon freshly grated nutmeg","6 tablespoons unsalted butter, cut into pieces","1/4 cup plus 2 tablespoons all-purpose flour","6 cups whole milk","Coarse salt","1/4 teaspoon freshly grated nutmeg","Homemade Pasta"],directions:["Make the filling: Preheat oven to 400 degrees. Drizzle squash halves with oil, and season with salt and pepper. Roast squashes, cut sides down, on a rimmed baking sheet until tender and browned, about 1 hour. Let cool. Scoop flesh from skins, and puree in a food processor until smooth.","Melt butter in a small saucepan over medium heat. Continue to cook until browned and fragrant, about 3 minutes. Transfer to a bowl."],name:"fall-roasted-butternut-squash-lasagna"},"summer-grits-icecream":{title:"Grits Praline & Brown Butter Ice Cream",excerpt:'"Decadent" isn’t a word we throw around lightly',source:{name:"Anson Mills",url:"http://www.ansonmills.com/recipes/480?recipes_by=grain"},cookTime:"2 hr 20 min",ingredients:["2 ounces (4 tablespoons) European-style unsalted butter","1 cup heavy cream","1 cup whole milk","6 large egg yolks","1/3 cup sugar","1 1/2 teaspoons vanilla extract","1/8 teaspoon fine sea salt","2 ounces Anson Mills Antebellum Coarse Yellow Grits or Antebellum Coarse White Grits","2 1/2 cups spring or filtered water","1 teaspoon fine sea salt","3.5 ounces sugar"],directions:["Make the ice cream base: Set a large bowl in a sink or basin filled with lots (at least 3 quarts) of ice cubes and cold water. Have a fine-mesh strainer nearby. Melt the butter in a small heavy-bottomed saucepan over low heat, stirring with a wooden spoon to scrape the browning milk solids back into the butter, until the butter is the color of a hazelnut in the shell and the kitchen smells miraculous, 3 to 5 minutes. Pull the pan off the heat and set it aside.","Pour the cream and milk into a medium heavy-bottomed saucepan set over medium-high heat. Whisk the egg yolks and sugar in a medium bowl. Drizzle the hot butter cautiously into the yolk-sugar mixture a little at a time, whisking well as you do."],name:"summer-grits-icecream"},"fall-peanut-butter-cookie":{title:"Peanut Butter Cookie with Salted Peanut Caramel",excerpt:"This recipe takes Peanut Butter Cookies to the next level",source:{name:"David Lebovitz",url:"http://www.davidlebovitz.com/2008/12/peanut-butter-cookies-with-salte-1/"},cookTime:"45 min",ingredients:["8 tablespoons (115g) unsalted butter, at room temperature","1/2 cup (120g) packed light brown sugar","1/2 cup (100g) granulated sugar","1 large egg, at room temperature","1 teaspoon vanilla extract","3/4 cup (200g) creamy salted peanut butter","1 3/4 cups (250g) flour","1/2 teaspoon baking soda","1/4 teaspoon salt","1 cup (250ml) heavy cream","1/2 cup (125ml) water","1 cup (200g) granulated sugar","1 tablespoon light corn syrup or glucose","1/8 teaspoon coarse salt","3/4 cup (100g) finely chopped roasted salted peanuts"],directions:["Preheat the oven to 350F and line two baking sheets with parchment paper or silicone baking mats.","With an electric mixer, or by hand, make the cookie dough by beating the butter, brown and granulated sugar until smooth. Beat in the egg and vanilla until well blended. If using an electric mixer, scrape down the sides of the bowl."],name:"fall-peanut-butter-cookie"},"fall-amatriciana":{title:"Bucatini all' Amatriciana",excerpt:"This dish is named for the town of Amatrice...considered by many Italians to be birthplace of the best cooks on the peninsula",source:{name:"Mario Batali",url:"http://www.mariobatali.com/recipes/bucatini-allamatriciana/"},cookTime:"30 min",ingredients:["1/4 cup extra-virgin olive oil","12 ounces thinly sliced guanciale pancetta, or good bacon","1 red onion, cut lengthwise in half and then into 1/4-inch-thick half-moons","3 cloves garlic, sliced","1 1/2 teaspoons hot red pepper flakes","2 cups Basic Tomato Sauce","1 pound Bucatini","Freshly grated Pecorino Romano"],directions:["Bring 6 quarts of water to a boil in a large pot, and add 2 tablespoons salt.","Meanwhile, in a 10- to 12-inch saute pan, combine the olive oil, ganciale, onion, garlic, and re pepper flakes; set over low heat and cook until the onion is softened and the guanciale has rendered much of its fat, about 12 minutes."],name:"fall-amatriciana"},"fall-orecchiette-sausage-ragu":{title:"Orecchiette with red lamb sausage & carrots",excerpt:"Chef di Cucina Matt Abdoo expounded on the virtues of the fundamental building block of Italian cooking: fresh pasta",source:{name:"Mario Batali",url:"http://www.mariobatali.com/recipes/orecchiette-with-red-lamb-sausage-carrots/"},cookTime:"45 min",ingredients:["1 pound ground lamb","1 1/2 teaspoons salt","1 tablespoon red wine","1 teaspoon cayenne pepper","2 teaspoons garlic purée","2 tablespoons roasted red pepper purée","1 teaspoon freshly ground black pepper","2 tablespoons sweet paprika","1 teaspoon smoked paprika","1 pint carrot juice","2 cups diced carrots","2 cups chopped carrots","1 teaspoon sugar","Orange zest, to taste","Salt and pepper, to taste","1/4 cup chicken stock","2 tablespoons of unsalted butter","1 pound orecchiette pasta","1/4 cup pecorino cheese","Extra virgin olive oil","Breadcrumbs, for garnish"],directions:["To make the spice mixture for the sausage: In a bowl, combine spices, lamb, salt, and water. Incorporate thoroughly using your hands. Set aside.","To make the carrot puree: Cook carrots in carrot juice until tender. Strain, and reserve the diced carrots. Puree the remaining chopped carrots. Season with orange zest, salt and pepper to taste.  Fold the diced carrots into the seasoned carrot puree. Set aside."],name:"fall-orecchiette-sausage-ragu"},"winter-braised-duck":{title:"Italian Red-Wine Braised Duck w/ Olive Gremolata",highlighted:!0,excerpt:"A good braise always trumps a steak or a roast, both in terms of complex flavors and satisfaction",source:{name:"NY Times",url:"http://www.nytimes.com/recipes/1014424/italian-red-wine-braised-duck-with-olive-gremolata.html"},cookTime:"2 hr 30 min",ingredients:["4 Muscovy duck legs (about 4 pounds), untrimmed","Salt and pepper","1/2 teaspoon coriander seed, toasted and coarsely ground","1/2 teaspoon fennel seed, toasted and coarsely ground","2 tablespoons olive oil","2 cups finely diced onion","3/4 cup finely diced carrot","3/4 cup finely diced celery","1 large thyme sprig","1 bay leaf","1 4-inch strip of orange peel, pith removed","4 garlic cloves, minced","2 tablespoons tomato paste","1 cup chopped canned or fresh tomatoes","1 cup dry red wine","3 cups chicken broth","Pinch cayenne or red pepper, optional","Olive gremolata for garnish"],directions:["Trim duck legs of extraneous fat with a sharp knife, leaving a thin layer on top. (It is best to do this straight from the fridge, while fat is still firm.) Save duck fat for rendering.","Season each leg generously with salt and pepper, then sprinkle with ground coriander and fennel. Massage seasoning into meat and leave at room temperature for 30 minutes, or wrap and refrigerate overnight."],name:"winter-braised-duck"},"fall-chocolate-chai-cupcake":{title:"Chocolate Chai Spice Cupcake",excerpt:"The moist chocolatey goodness of the cake can live on its own",source:{name:"Cupcake Bakeshop",url:"http://cupcakeblog.com/?p=50"},cookTime:"55 min",ingredients:["200 gram bar of Valrhona 61% cacao","3 sticks butter","2-1/4 cups sugar","8 eggs","1-1/4 cup flour","1/4 cup cocoa powder, unsweetened","1-1/2 teaspoons baking powder","3 teaspoons chai spice mix","pinch of salt","1 cup (2 sticks) butter","4-5 cups powdered sugar, sifted","1/4 cup milk","2 teaspoons chai spice mix","2 teaspoons minced fresh ginger"],directions:["With a small food processor, grind up the whole fennel and cloves.","Transfer to a small bowl and add remaining spices. Mix to combine."],name:"fall-chocolate-chai-cupcake"},"fall-mexican-rice":{title:"Mexican Rice",excerpt:"",source:{name:"NY Times",url:"http://www.nytimes.com/recipes/1016674/mexican-rice.html"},cookTime:"40 min",ingredients:["1 large clove garlic, roughly chopped","2 cups canned tomatoes (fresh tomatoes can be used)","1/2 cup green bell pepper, roughly chopped","1 medium onion, roughly chopped","1/2 medium jalapeño, seeds and veins removed","1 teaspoon salt","1/2 cup chicken stock or water","2 tablespoons vegetable oil","1 heaping cup long-grain white rice, rinsed"],directions:["Blend vegetables, salt and stock or water together into a mostly smooth purée (a few small pieces of onion and pepper are fine).","In a large skillet with a tightfitting lid, heat oil. Add rice and toast until it absorbs most of the oil and begins to smell nutty."],name:"fall-mexican-rice"},"fall-whole-wheat-goldfish-crackers":{title:"Whole Wheat Goldfish Crackers",excerpt:"",source:{name:"Smitten Kitchen",url:"http://smittenkitchen.com/blog/2011/03/whole-wheat-goldfish-crackers/"},cookTime:"1 hr 5 min",ingredients:["6 ounces (1 1/2 cups coarsely grated) sharp cheddar","4 tablespoons (2 ounces or 57 grams) butter","1/2 cup (2 1/2 ounces or 62 grams) whole wheat flour","1/4 cup (1 1/8 ounces or 31 grams) all-purpose flour","1/8 teaspoon onion powder","1/8 to 1/4 teaspoon table salt"],directions:["Preheat oven to 350°F. Combine all ingredients in a food processor, running the machine until the dough forms a ball, about two minutes.","If the dough feels warm or worrisome-ly soft, wrap it in waxed paper or plastic wrap and chill it in the fridge for 30 to 45 minutes. This also makes it easier to transfer shapes once they are rolled out."],name:"fall-whole-wheat-goldfish-crackers"},"winter-world-peace-cookie":{title:"P.Hermé & D.Greenspan's World Peace Cookies",excerpt:"Shortbread cookie meets salted chocolate chip, and world peace feels within reach",source:{name:"Food52",url:"http://food52.com/recipes/25372-pierre-herme-dorie-greenspan-s-world-peace-cookies"},cookTime:"35 min",ingredients:["1 1/4 cups all-purpose flour","1/3 cup unsweetened cocoa powder","1/2 teaspoon baking soda","1 stick plus 3 tablespoons (11 tablespoons) unsalted butter, room temperature","2/3 cups (packed) light brown sugar","1/4 cup granulated sugar","1/2 teaspoon fleur del sel or 1/4 teaspoon fine sea salt","1 teaspoon pure vanilla extract","5 ounces bittersweet chocolate, chopped into chips, or a generous 3/4 cup store-bought mini chocolate chips"],directions:["Sift the flour, cocoa and baking soda together.","Working with a stand mixer, preferably fitted with a paddle attachment, or with a hand mixer in a large bowl, beat the butter on medium speed until soft and creamy. Add both sugars, the salt and vanilla extract and beat for 2 minutes more."],name:"winter-world-peace-cookie"},"winter-chocolate-tart":{title:"Chocolate Tart",highlighted:!0,excerpt:"A good chocolate tart doesn’t need to be fancy, but it needs to be deep, dark, and yes, somewhat decadent.",source:{name:"David Lebovitz",url:"http://www.davidlebovitz.com/2011/10/chocolate-tart-recipe/"},cookTime:"1 hr",ingredients:["1 1/4 cup (250 g) sugar","6 tablespoons (90 ml) warm coffee","4 ounces (115 g) unsalted butter, cubed, room temperature","pinch of sea salt","4 ounces (115 g) bittersweet or semisweet chocolate, chopped","2 ounces (55 g) unsweetened chocolate, chopped","2 large eggs","1/4 cup (35 g) flour","1 tablespoon dark rum or 1 teaspoon vanilla extract","One 9–10 inch prebaked tart shell"],directions:["Preheat oven to 350ºF (180ºC.)","Spread the sugar in an even layer in the bottom of a large, heavy-duty saucepan or Dutch oven. Cook the sugar over moderate heat until the edges liquefy and being to caramelize. Use a heatproof utensil to gently drag the liquefied sugar toward the center of the pan, encouraging the sugar to melt evenly."],name:"winter-chocolate-tart"},"winter-braised-eggs-with-beef":{title:"Braised eggs w/ beef, smoked aubergine & tomato",excerpt:"",source:{name:"Ottolenghi",url:"http://www.ottolenghi.co.uk/recipes/meat/braised-eggs-with-beef-smoked-aubergine-and-tomato-shop"},cookTime:"1 hr 5 min",ingredients:["4 aubergines (1.1kg gross)","1 tbsp olive oil, plus extra for drizzling","1 large onion, finely chopped (200g net)","6 garlic cloves, roughly chopped (20g net)","1/2 tsp chilli flakes","1/2 tsp ground cinnamon","1/2 tsp ground cumin","2 tsp tomato paste","300g minced beef","2 medium tomatoes, chopped (100g net)","2 tsp finely chopped preserved lemon (15g)","4 eggs","3/4 tsp sumac","1 tbsp chopped parsley","Salt and black pepper","40g tahini","2 tbsp lemon juice","1 garlic clove, crushed"],directions:["Pierce the aubergines with a sharp knife in a few places and place each directly over a naked flame on your stovetop. Cook on medium heat for 20 minutes, turning occasionally with metal tongs until the outside is totally burnt and the aubergine starts to collapse on itself. Alternatively, place the pierced aubergines on a tin foil lined tray under a hot grill in the oven for an hour, turning every 20 minutes. Remove from and place in a colander.","Cut a single slit in each aubergine, from top to bottom and allow the juices to strain. Once cool enough to handle, scoop out all the flesh, avoiding all black skin, and set aside. You should have about 370g aubergine flesh."],name:"winter-braised-eggs-with-beef"},"winter-cashew-gateau":{title:"Cashew Gateau with Coffee Cardamom Mousse",excerpt:'The inspiration for the caramel stained "glass" panel comes from my grandmother',source:{name:"Tartelette",url:"http://www.tarteletteblog.com/2008/08/cashew-gateau-with-coffee-cardamom.html"},cookTime:"1 hr 30 min",ingredients:["3/4 cups cashew, toasted/skinned","1/3 cup cake flour, unsifted","1 Tbsp. cornstarch","3 large egg yolks","1/2 cup sugar, divided (2Tb & 6 Tb)","1/2 tsp. vanilla extract","1/2 tsp. grated lemon rind","2 lg. egg whites","2 Tb melted butter, cooled","1/2 teaspoon ground cardamom","1/2 cup espresso or strong coffee","1/4 cup sugar","1 tsp powdered unflavored gelatin, softened in 1 tablespoon cold water","1 cup heavy cream, cold","1/2 cup heavy cream","3/4 cup chopped chocolate or chocolate chips (about 6 oz or 180 gr)"],directions:["Position rack in the lower 3rd of the oven and preheat to 350 degrees.","Grease and flour a 8” X 4” inch round springform pan."],name:"winter-cashew-gateau"}}}();

